import React, { useEffect, useState } from 'react';
import axios from 'axios';
import BootstrapTable from 'react-bootstrap-table-next';

export default function Index(){
    const [anggotas,setAnggotas] = useState([]);

    useEffect(()=>{
        fetchData()
    },[])

    const columns = [{
        dataField: 'id',
        text: 'ID'
      }, {
        dataField: 'nama',
        text: 'Nama',
        sort: true
      }, {
        dataField: 'no_ktp',
        text: 'No KTP',
        sort:true
      },
      {
        dataField: 'email',
        text: 'Email',
        sort:true
      }

    ];

    var config = {
        method: 'get',
        url: 'http://127.0.0.1:8000/api/anggota/index',
        headers: { 
          'Authorization': 'Bearer 2|FR7C7kExqtDBwp5B9DhBir9E8e3OUdTLm2fxX83c'
        }
      };

    const fetchData = async ()=>{
        axios(config).then(function (response) {
            setAnggotas(response.data)
        })
        .catch(function (error) {
            console.log(error);
        });
    }

    return (
        <div className="clearfix row">
            <div className="col-lg-12">
                <div className="card">
                    <div className="header pb-0">
                        <div className="row">
                            <div className="col-md-9">
                                <a href="{void(0)}" className="btn btn-info"><i className="fa fa-plus"></i> Pengajuan</a>
                                <a href="{void(0)}" data-toggle="modal" data-target="#modal_migrasi" className="btn btn-danger"><i className="fa fa-upload"></i> Migrasi</a>
                            </div>
                        </div>
                    </div>
                    <div className="body">
                        <div className="table-responsive">
                            <BootstrapTable keyField='id' data={ anggotas } columns={ columns } />
                            {/* <table className="table table-hover m-b-0 c_list table-nowrap" id="data_table">
                                <thead style={{background: "#eee",verticalAlign:"middle"}}>
                                    <tr>
                                        <th>No</th>
                                        <th>Nama</th>
                                        <th>No KTP</th>
                                        <th>Telepon</th>
                                        <th>Email</th>
                                        <th>Alamat</th>
                                        <th>Jenis Kelamin</th>
                                        <th>Actions</th>
                                    </tr>
                                </thead>
                                <tbody> */}
                                    {/* {
                                        anggotas.length > 0 && (
                                            anggotas.map((row, key)=>(
                                                <tr key={key}>
                                                    <td>{key+1}</td>
                                                    <td>{row.nama}</td>
                                                    <td>{row.no_ktp}</td>
                                                    <td>{row.telepon}</td>
                                                    <td>{row.email}</td>
                                                    <td>{row.alamat}</td>
                                                    <td>{row.jenis_kelamin}</td>
                                                    <td>
                                                        <Link to={`/product/edit/${row.id}`} className='btn btn-success me-2'>
                                                            Edit
                                                        </Link>
                                                    </td>
                                                </tr>
                                            ))
                                        )
                                    } */}
                                {/* </tbody>
                            </table> */}
                        </div>
                    </div>
                </div>
            </div>
        </div>);
}
